Tahira Kashyap has given us more goals to love her by slapping the trolls right back for calling her Ayushmann’s brother.

@tahirakashyap is one person who doesn’t need any introduction. She is a writer, director, journalist, and is battling cancer like a real warrior. She has been sporting short hair ever since she was detected with pre-invasive breast cancer last year. Her very public and courageous battle with cancer has been a source of inspiration for many.

Since Tahira was detected with cancer she has been trying to break all the stereotypes and stigma around the disease. Through posting pictures and openly talking about her scars, she has tried to break the so-called notions of perfect beauty, but when will the society improve?

So you know how trolls just can’t appreciate anything. Because of her short hair, they called her ‘Ayushmann’s brother’. Now celebs generally have their own way of handling trolls. Tahira slammed back at the trolls in the funniest way by replying “Get over the ‘Bhai Bhai’ thing!” Read more, link in bio
